import React from 'react'
import WinsByTimeGraph from './WinsByTimeGraph';
import './Graphs.css';
import WinsByColorGraph from './WinsByColorGraph';
import WinsByWhiteDonut from './WinsByWhiteDonut';
import WinsByBlackDonut from './WinsByBlackDonut';

function Graphs({ chessgames, cumulativeData, filter }) {
  return (
    <div className='container'>
        <div className='winDonuts'>
          <div id='whiteDonut'>
            <WinsByWhiteDonut cumulativeData={cumulativeData} />
          </div>
          <div id="blackDonut">
            <WinsByBlackDonut cumulativeData={cumulativeData} />
          </div>
        </div>
        <div className='winsGraph'>
          <WinsByTimeGraph chessgames={chessgames} cumulativeData={cumulativeData} filter={filter}/>
        </div>
    </div>
  )
}

export default Graphs;
